window.bookSummaryJSON = "<p>Where is Wendy? Leading a labor strike against the Lost Boys, of course. In Jane Yolen's first full collection in more than 10 years, discover new and uncollected tales of beloved characters, literary legends, and much more. </p> <p>A Scottish academic unearths ancient evil in a fishing village. Edgar Allan Poe's young bride is beguiled by a most unusual bird. Dorothy, lifted from Kansas, returns as a gymnastic sophisticate. Emily Dickinson dwells in possibility and sails away in a starship made of light. Alice's wicked nemesis has jaws and claws but really needs a sense of humor. </p> <p>Enter the Emerald Circus and be astonished by the transformations within. </p> <p><b>Winner of the 2018 World Fantasy Award.</b></p>"; 
